const Navbar = () => {
    return(
        <nav className={s.nav}>
      <div className={s.item}>
        <a рк>Profile</a></div>
        <div className={s.item}>
        <a>Messages</a></div>
        <div className={s.item}>
        <a>News</a></div>
        <div className={s.item}>
        <a>Music</a></div>
        <div className={s.item}>
        <a>Settings</a></div>
      </nav>
    )
};

export default Navbar;
